desc:
--- Lead scrap, namely the following: 
scrap lead-soft covered by ISRI code word 'Racks'; 
mixed hard or soft scrap lead covered by ISRI code word 'Radio'; wheel weights covered by ISRI code word 'Ropes'; 
mixed common babbit covered by ISRI code word 'Roses'; Scrap wet whole intact lead batteries consisting of SLI (starting, lighting an ignition), automotive, truck, 8-D and commercial golf cart and marine type batteries covered by ISRI code word 'Rink'; 
Scrap industrial intact lead cells consisting of plates enclosed by some form of complete plastic case covered by ISRI code wordn 'Rono'; 
Scrap whole Intact Industrial Lead Batteries Consisting of bus, diesel, locomotive, telephone or steel cased batteries covered by ISRI code word 'Roper';

Brass chain, set with rhinestones, for use in the manufacture of jewellery; 
Paua shells in metal settings; 
Ornaments for use in the manufacture of footwear or footwear fittings

Cast iron grilles, of a weight not exceeding 3 kg, not further worked than as cast, cut and ground, for use in the manufacture of finished grilles for non-industrial non-portable stoves or ranges, for gas fuel or for both gas or other fuels; 
For appliances, excluding cooking appliances and plate warmers; 
For cooking appliances and plate warmers for gas fuel or for both gas and other fuels, excluding non-portable stoves or ranges (including those specially designed for use on boats)

Couplings for sucker rods, pony rods or polished rods for oilfield related pumps; 
Fishing tools and parts thereof to be employed in the exploration, discovery, development, maintenance, testing, depletion or production of oil or natural gas wells or for drilling machinery employed in the exploration, discovery, development or operation of potash or rock salt deposits; 
For climbing or mountaineering; 
For keeping nets open and swivels, to be employed in commercial fishing or in the commercial harvesting of marine plants; 
For use in the manufacture of detectors for propane or other toxic fumes; 
For use in the manufacture of fire fighting vehicles; 
For use in the manufacture of goods of Section XVI or of Chapter 73, such goods being used in the recovery or production of crude oil from shales, oil-sands or tar-sands; 
For use in the manufacture or repair of engines or parts thereof for commercial fishing vessels; 
Forged steel clevis hooks and eye hooks for use in the manufacture of debris chutes; 
Identification bands for migratory birds; 
Pitless well heads and parts thereof; 
Reusable containers, specially designed to be employed in the transportation of motor vehicle components which are free of customs duties, presented with the goods therein; 
Seat post clamps and cable hangers for use in the manufacture of unicycles, bicycles or tricycles; 
Semi-elliptical heads, of an external diameter of either 609.6 mm or 762 mm, to specification ASTM A455, for use in air compressor tanks; 
Snap hooks of forged steel, zinc plated, 12.5 cm to 23 cm in length, for use in the manufacture of debris chutes and chute hoists; 
Steel stanchions for confining livestock either in pens or individually; 
The following to be employed in the exploration, discovery, development, maintenance, testing, depletion or production of oil or natural gas wells or potash or rock salt deposits: 
Flanged casing heads; 
Screwed casing heads for surface casings of an external diameter exceeding 273 mm, or rated for service in working pressures exceeding 14 MPa W.O.G. (water, oil, gas); 
Well packers and parts thereof; 
To be employed in the processing, storing or insemination of animal semen; 
Tracks for use in the manufacture of skid steer loaders; 
Vacuum evaporator masks, of stainless steel, having a 90% front etch and 10% back etch, for the production of photo cells; 
Wick sustainers for use in the manufacture of candles

The following foil of a thickness not exceeding 0.15 mm:
Unworked, containing by weight less than 60% of nickel;
Worked

Cups for use in the manufacture of candles;
Ferrules for use in the manufacture of pencils;
Fish egg incubators and parts thereof;
For climbing or mountaineering;
Identification bands for migratory birds; 
Pigeon countermark leg bands;
To be employed in the manufacture of sera, antisera, toxoids, viruses, toxins or antitoxins, virus or bacterial vaccines, bacteriophage or bacterial lysates, allergenics, liver extracts, pituitary extracts, epinephrine or its solutions, insulin (with or without zinc, globin or protamine), and blood plasma or serum of human origin, or fractions thereof, or extenders or substitutes therefor

Discs or slugs, containing by weight 90% or more of zinc;
Gutters, roof capping, skylight frames and other fabricated building components;
Zinc tubes, pipes and tube or pipe fittings (for example couplings, elbows, sleeves)

